select count(key) as keycount,key,screen,array_to_string(array_agg(id), ',') as ids from locale_message where lang='en' group by key,screen having count(key) > 1 ;
select count(key) as keycount,key,screen,array_to_string(array_agg(id), ',') as ids from locale_message where lang='gu' group by key,screen having count(key) > 1 ;
/*delete query
===============
 */
delete from locale_message where id in('2106','3599','3618');

CREATE TABLE public.tempData
(
  id bigint NOT NULL,
  key character varying(255),
  lang character varying(255),
  screen character varying(255),
  fieldname character varying(255),
  value character varying(255),
  CONSTRAINT tempdata_pkey PRIMARY KEY (id)
)
WITH (
  OIDS=FALSE
);
ALTER TABLE public."tempData"
  OWNER TO postgres
